import React, { Component } from 'react';
import styles from './List.module.css';
import Card from '../../components/Card/Card';
import Aux from '../../hoc/Aux';
import InputList from '../InputList/InputList';

class List extends Component {
    state={
        cards: []
    }

    render(){
        let displayCards = []
        if (this.state.cards.length > 0){
            this.state.cards.map((cardName, index) => {
                    displayCards.push(<Card key={cardName+index} cardName={cardName}/>);
                })
        }

        return(
            <Aux>
                <div className={styles.List}>{this.props.listName}</div>
                {displayCards}
                <InputList createNewList={(listName)=> this.updateListState(listName)}/>
            </Aux>
        );
    }
}

export default List;
